import React, { useState } from 'react';
import { View, StyleSheet, Text, TextInput, TouchableOpacity } from 'react-native';

export default function App() {

  const [cep, setCep] = useState("")
  const [logradouro, setLogradouro] = useState("")
  const [bairro, setBairro] = useState("")
  const [localidade, setLocalidade] = useState("")
  const [uf, setUf] = useState("")

  async function BuscarCep() {
    let url = `https://viacep.com.br/ws/${cep}/json/`;

    let req = await fetch(url);
    let res = await req.json();

    setLogradouro(res.logradouro);
    setBairro(res.bairro);
    setLocalidade(res.localidade);
    setUf(res.uf);
  }

  return (
    <View style={styles.conteinerPrincipal}>
      <View style={styles.tabBar}>
        <Text style={styles.title}>Buscador de Cep</Text>
      </View>

      <View style={styles.containerCep}>
        <TextInput
          style={{
            borderColor: "#000000",
            borderWidth: 2,
            width: 200,
            fontSize: 18,
            marginTop: 30,
            marginEnd: 20,
            borderRadius: 10,
          }}
          value={cep}
          onChangeText={(texto) => setCep(texto)}
          placeholder='Cep'
        />

        <TouchableOpacity style={styles.botaoBuscar} onPress={BuscarCep}>
          <Text style={styles.textoBotaoBuscar}>Buscar</Text>
        </TouchableOpacity>
      </View>

      <TextInput
        style={styles.caixaTexto}
        value={logradouro}
        onChangeText={(texto) => setLogradouro(texto)}
        placeholder='Logradouro'
      />

      <TextInput
        style={styles.caixaTexto}
        value={bairro}
        onChangeText={(texto) => setBairro(texto)}
        placeholder='Bairro'
      />

      <TextInput
        style={styles.caixaTexto}
        value={localidade}
        onChangeText={(texto) => setLocalidade(texto)}
        placeholder='Cidade'
      />

      <TextInput
        style={{
          borderColor: "#000000",
          borderWidth: 2,
          width: 80,
          fontSize: 18,
          marginTop: 10,
          marginEnd: 20,
          borderRadius: 10,
          marginHorizontal: 20,
        }}
        value={uf}
        onChangeText={(texto) => setUf(texto)}
        placeholder='Estado'
      />
    </View>
  );
}


const styles = StyleSheet.create({
    conteinerPrincipal: {
        flex: 1,
        flexDirection: 'column'
    },

    tabBar: {
        flexDirection: 'row',
        height: 70,
        backgroundColor: "#018786"
    },

    title: {
        color: "#FFFFFF",
        fontSize: 25,
        fontWeight: "bold",
        alignSelf: "center",
        margin: 20
    },

    containerCep: {
        flexDirection: 'row',
        height: 100,
        marginHorizontal: 20,
    },

    botaoBuscar: {
        backgroundColor: "#018786",
        width: 120,
        height: 70,
        marginTop: 30,
        marginEnd: 20,
        borderRadius: 10,
        padding: 15
    },

    textoBotaoBuscar: {
        color: "#FFFFFF",
        fontSize: 18,
        fontWeight: "bold",
        alignSelf: "center"
    },

    caixaTexto: {
        borderColor: "#000000",
        borderWidth: 2,
        padding: 15,
        fontSize: 18,
        borderRadius: 10,
        marginTop: 10,
        marginHorizontal: 20
    }
})
